class Entry:
    def __init__(self,key,value,removed=False):
        self.key = key
        self.value = value
        self.removed = removed

    def __lt__(self, other):
        other: Entry
        return self.value < other.value or self.value==other.value and self.key<other.key


class KeepTrackOfBest:
    def __init__(self):
        self.items: dict[int, Entry] = dict()
        self.best: list[Entry] = []

    def add(self, key, value):
        if key in self.items:
            self.items[key].removed = True
        entry = Entry(key, value, False)
        self.items[key] = entry
        heapq.heappush(self.best, entry)

    def pop(self, key):
        entry: Entry = self.items.pop(key)
        entry.removed = True
        if not self.items:
            self.__init__()
            return entry.value
        while self.best[0].removed:
            heapq.heappop(self.best)
        if (len(self.best) << 1) > len(self.best):
            self.best = [E for E in self.best if E.key in self.items]
            heapq.heapify(self.best)
        return entry.value

    def get_best(self, n=5):
        res = []
        temp = []
        while n and self.best:
            entry:Entry = heapq.heappop(self.best)
            if entry.removed:
                continue
            n -= 1
            temp.append(entry)
            res.append(entry.key)
        print([e.value for e in temp])
        while temp:
            el = temp.pop()
            heapq.heappush(self.best, el)
        return res


class MovieRentingSystem:

    def __init__(self, n: int, entries: List[List[int]]):
        self.by_movie_avail = {}
        while entries:
            shop, movie, price = entries.pop()
            movielist: KeepTrackOfBest = self.by_movie_avail.setdefault(movie, KeepTrackOfBest())
            movielist.add(shop, price)
        self.rented = KeepTrackOfBest()

    def search(self, movie: int, *_args) -> List[int]:
        if movie not in self.by_movie_avail:
            return []
        movielist: KeepTrackOfBest = self.by_movie_avail[movie]
        res = movielist.get_best(5)
        return res

    def rent(self, shop: int, movie: int, *_args) -> None:
        assert movie in self.by_movie_avail
        movielist: KeepTrackOfBest = self.by_movie_avail[movie]
        price = movielist.pop(shop)
        self.rented.add((movie, shop), price)

    def drop(self, shop: int, movie: int, *_args) -> None:
        price = self.rented.pop((movie, shop))
        movielist: KeepTrackOfBest = self.by_movie_avail.setdefault(movie, KeepTrackOfBest())
        movielist.add(shop, price)

    def report(self, *_args) -> List[List[int]]:
        best_rented = self.rented.get_best(5)
        return [[b, a] for (a, b) in best_rented]

